import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals'; // Import reportWebVitals

// Create root using React 18's createRoot API
const root = ReactDOM.createRoot(document.getElementById('root'));

// Render the app inside StrictMode
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Call reportWebVitals to log performance metrics
reportWebVitals(); // Logs performance metrics or handles errors gracefully
